using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// This protocol is implemented by the UIViewController properties topLayoutGuide and bottomLayoutGuide to support using Auto Layout with a view controller’s view, starting in iOS 7. You can use layout guides as layout items in the NSLayoutConstraint factory methods.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UILayoutSupport_Protocol/index.html#//apple_ref/occ/intf/UILayoutSupport"/>    [iOSVersion(7)]    public interface UILayoutSupport//: NSObjectProtocol    {        /// <summary>        /// Provides the length, in points, of the portion of a view controller’s view that is overlaid by translucent or transparent UIKit bars. (required)        /// </summary>        [iOSVersion(7)]        [Export("length")]        CGFloat Length { get; private set; }    }}